import React from "react";
import "../assets/css/signup.css";
const Signup = () => {
  return (
    <div className="signUp position-relative">
      <div className="position-absolute signUpBg d-flex justify-content-center align-items-center">
        <div className="mainSignUp position-relative d-flex justify-content-center align-items-center">
          <img
            src={require("../assets/image/signupTopLeft.png")}
            className="img-fluid topLeft"
            alt="signup Top Left"
          />
          <div className="d-flex flex-column">
            <img
              src={require("../assets/image/logo.png")}
              className="img-fluid"
              width={"100"}
              alt="Query Overflow"
            />
            <div className="pt-2">
              <p className="fs-3 mb-1">Query</p>
              <p className="fs-3 ms-1 fw-bold mb-1">Overflow</p>
            </div>
          </div>
          <img
            src={require("../assets/image/signupBottomRight.png")}
            className="img-fluid bottomRight"
            alt="signup Bottom Right"
          />
        </div>
      </div>
    </div>
  );
};

export default Signup;
